create table screenings
(
    id                int  not null
        primary key,
    date              date not null,
    time              time not null,
    halls_hall_number int  not null,
    films_id          int  not null,
    constraint screenings_films
        foreign key (films_id) references films (id),
    constraint screenings_halls
        foreign key (halls_hall_number) references halls (hall_number)
);

